
from typing import List

class Solution:
	def numOfMinutes(self, n: int, headID: int, manager: List[int], informTime: List[int]) -> int:
		time = 0
		leaves = [idx for idx, t in enumerate(informTime) if t == 0]
		for i in leaves:
			j, currTime = i, 0
			while manager[j] != -1:
				currTime += informTime[j]
				j = manager[j]
			currTime += informTime[headID]
			time = max(time, currTime)
		return time

